import React from 'react';
import './App.css';
import { Navbar, Nav } from 'react-bootstrap';
import Dashboard from "./components/dashboard";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


class App extends React.Component {

    render() {
        return (
            <Router>
                <Switch>
                    <Route exact path="/">
                        <Dashboard />
                    </Route>
                    <Route path="/about">
                        <Dashboard />
                    </Route>
            </Switch>
        </Router>
      );

    }
}

export default App;
